import PySimpleGUI as sg


def make_firstWdw():
    ginBase64 = b""

    layout = [
        [sg.Text("Welcome to ginrex", pad=(1, 1), font="Helvetica 14")],
        [
            sg.Button(
                "",
                image_data=ginBase64,
                button_color=(sg.theme_background_color(), sg.theme_background_color()),
                border_width=0,
                # key="Exit",
            )
        ],
        [
            sg.B(
                "Exit",
                border_width=0,
                button_color=(sg.theme_background_color(), sg.theme_background_color()),
            )
        ],
    ]

    return sg.Window(
        "Ginrex",
        layout,
        no_titlebar=True,
        element_justification="c",
        size=(350, 300),
        resizable=True,
    )
